import React from 'react'
import './App.scss';
import Navbar from './components/Navbar/Navbar';
import Home from './components/Home/Home';
import { Route, Routes } from 'react-router-dom';

function App() {
  return (
    <div className='app'>
      <Navbar />
      <Routes>
        <Route path='/' ></Route>
      </Routes>
      <Home />
    </div>
  );
}

export default App
